syntax = "proto3";
option java_multiple_files = true;
import "search/area.proto";
message Search {
    map<string, search.Area> area = 1;
    map<string, string> city = 2;
    optional int32 code = 3;
    optional string date = 4;
    optional string error = 5;
    optional string result = 6;
    
}